import React from 'react'

const Search = ({check,checker}) => {

    const Input = e =>{
        
        checker(e.target.value)

    }

  return (
    <div className='search'>
        <input 
        type="text"
        value={check}
        placeholder='Search Here'
        onChange={Input}
         />
    </div>
  )
}

export default Search
